import React from 'react';
import { Carousel } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import './MyCarousel.css'; // Import custom CSS for Carousel

const MyCarousel = () => {
  const img1 = require('./img3.jpeg');
  const img2 = require('./img2.jpeg');
  const img3 = require('./img1.jpeg');
  const img4 = require('./img4.jpeg');
  const img5 = require('./img5.jpeg');

  return (
    <div className='carousel bg-gray-200'>
      <h2 className="delicacies-heading text-3xl font-bold mb-4 text-center mt-4">Our Delicacies</h2>
      <div className="lightbox">
      <div className="row">
        <div className="col-lg-6">
          <img
            src={img1}
            data-mdb-img="https://mdbcdn.b-cdn.net/img/Photos/Slides/1.webp"
            alt="Table Full of Spices"
            className="w-100 mb-2 mb-md-4 shadow-1-strong rounded"
          />
          <img
            src="https://mdbcdn.b-cdn.net/img/Photos/Thumbnails/Square/1.webp"
            data-mdb-img="https://mdbcdn.b-cdn.net/img/Photos/Square/1.webp"
            alt="Coconut with Strawberries"
            className="w-100 shadow-1-strong rounded"
          />
        </div>
        <div className="col-lg-6">
          <img
            src="https://mdbcdn.b-cdn.net/img/Photos/Thumbnails/Vertical/1.webp"
            data-mdb-img="https://mdbcdn.b-cdn.net/img/Photos/Vertical/1.webp"
            alt="Dark Roast Iced Coffee"
            className="w-100 shadow-1-strong rounded"
          />
        </div>
      </div>
    </div>
    </div>
  );
};

export default MyCarousel;
